sys_variable_value.value:
(function execute(inputs, outputs) 
 {
  var response = JSON.parse(inputs.ResponseBody);
  outputs.status_code = inputs.StatusCode;
  if(inputs.StatusCode == "201" || inputs.StatusCode == "200" || inputs.StatusCode == "204")
  {
    var braches = [];  
    for(var i=0; i<response.length; i++) {
      braches.push(response[i].name);
    }
    outputs.branches = braches.toString();
  }
  else
  {
    outputs.error_message = inputs.ErrorMessage;
  }

})(inputs, outputs);

